import * as React from "react";

const Header = (props) => {
  return (
    <header>
      <div className="logo">
        <img src="/naveenda-logo.svg" />
      </div>
      <ul className="links">
        <li>
          <a href="/">Portfolio</a>
        </li>
        <li>
          <a href="https://twitter.com/NaveenDA_">Contact Me</a>
        </li>
        <li>
          <a href="#theme">
            <span className="fa fa-moon-o"></span>
            {/* ) : (
          <span className="fa fa-sun-o"></span>
        )} */}
          </a>
        </li>
      </ul>
    </header>
  );
};
export default Header;
